window.bookSummaryJSON = "<p><b>No touching today for a healthy tomorrow.</b></p> <p>For 50 years, the Key Corporation has defended humanity against a deadly virus that spreads through touch. Lovers don’t kiss, or even hold hands. Personal boundaries are valued above all. Break the laws, and you’ll face execution.</p> <p>Elodie, a talented young nurse, believes in the mission of the Key and has never questioned the laws that control her life. But Elodie is forced to break the rules when she sets out in search of a terminal patient who goes missing while under her care.</p> <p>From the outside, it seems like Aiden was given everything he could want from the Key - a purpose, an education, and a future. But Aiden knows more than he’s letting on, and the dark secrets he’s keeping could tear the Key’s strict society apart.</p> <p>When Elodie and Aiden’s lives collide, the fallout will be devastating. What do you do when the brutal system that once kept you safe hunts you down?</p> <p>Run.&nbsp;</p>"; 
